**Describe the bug**
We plan to deploy a PyTorch model with onnxruntime on windows platforms. We build our APP using visual studio 2019 for both x86 and x64 platforms. Everything is fine on win7 32-bit/win8/win10 systems but fails to run on win7 64-bit systems. For testing, we built a minimal program that just starts an ORT session.:
```C++
#include <iostream>
#include <onnxruntime_cxx_api.h>
using namespace std;
int main()
{
    Ort::Env env;
    Ort::RunOptions runOptions;
    Ort::Session session(nullptr);
    std:cout << "onnx env established. " << endl;
    system("pause");
    return 0;
}
```
and run it on a freshly installed win7 sp1 64-bit system, it gives the following error:
![微信图片_20220825101134](https://user-images.githubusercontent.com/7842342/186558498-861f40cc-915c-4170-98a9-be49cd7a26a0.jpg)
Following issue #4570 , I installed two windows updates [Update KB3068708](https://support.microsoft.com/en-us/help/3068708/update-for-customer-experience-and-diagnostic-telemetry) [Update KB3080149](https://support.microsoft.com/en-us/help/3080149/update-for-customer-experience-and-diagnostic-telemetry) and  VC_redist.x64.exe, the problem persists. 
I checked the dependencies using the depends.exe tool and found that a couple of API-MS-WIN-CORE-* Dlls are missing.
 
![无标题](https://user-images.githubusercontent.com/7842342/186571636-5941354f-ad23-42d3-900a-fddd8b9e3584.png)
The app runs well on win8/win10 systems, and the x86-built app can run on a win7 32-bit system. The only failure is with win7-64bit.

