**Expected behavior**
A clear and concise description of what you expected to happen.
KernelDef::CalculateHash()  should generate same hash key.

Basically the issue is KernelDef::CalculateHash() is internally invoking  hash_int() -->  MurmurHash3::x86_128() with first parameter to an int. On big endian platforms this generates a different hash.

I tried the below fix ( after hash_str (op_name_);) in KernelDef::CalculateHash() , and it works on AIX .

void KernelDef::CalculateHash() {
  uint32_t hash[4] = {0, 0, 0, 0};

  auto hash_int = [&hash](int i) { MurmurHash3::x86_128(&i, sizeof(i), hash[0], &hash); };
  auto hash_str = [&hash](const std::string& str) {
    MurmurHash3::x86_128(str.data(), gsl::narrow_cast<int32_t>(str.size()), hash[0], &hash);
  };

  // use name, start/end, domain, provider and the type constraints.
  // we wouldn't have two kernels that only differed by the inplace or alias info or memory types.
  // currently nothing sets exec_queue_id either (and would assumably be a runtime thing and not part of the base
  // kernel definition)

  hash_str(op_name_);

  if constexpr (onnxruntime::endian::native == onnxruntime::endian::little) {
    hash_int(op_since_version_start_);
  } else {
    const uint8_t* c = (const uint8_t*)&op_since_version_start_;
    hash_int((uint32_t)c[0] |
           (uint32_t)c[1] << 8 |
           (uint32_t)c[2] << 16 |
           (uint32_t)c[3] << 24);
  }

